import React from "react";
import search from '../../../assets/NavbarAssets/search.svg';
import style from '../'


const searchNav: React.FC = (props: any) => {
    props.title
    return (
        <div id="button-search">
            <input type="text" value={`Search for restaurant cuisine, chef`} id="input-search"/>
            <button type="submit"><img src={search} alt="search" id="button-icon"/></button>
        </div> 
    )
}

export default searchNav
